import React from "react";
import './options.css'

const Buttons=()=>{
    return(
        <div className="nav-buttons">
            <div className="top-buttons">
                <button className="opt"><a href="https://scora.io/platform/">Platform</a></button>
                <button className="opt"><a href="https://scora.io/scenarios/">Scenarios</a></button>
                <button className="opt"><a href="">Demo</a></button>
            </div>
            <div className="bottom-buttons">
                <button className="opt"><a href="https://scora.io/features/">Features</a></button>
                <button className="opt"><a href="">Pricing</a></button>
                <button className="opt"><a href="">Start Over</a></button>
            </div>
        </div>
    )
}

export default Buttons;
